(4, 0, 0, 0, 2, 'Quy Ä‘á»‹nh vá» ná»™i dung Ä‘Äƒng chá»§ Ä‘á» lÃªn diá»…n Ä‘Ã n', 'quy-dinh-ve-noi-dung-dang-chu-de-len-dien-dan', '', 'vietnamese', 1472367602, '<p>\r\n	Tá»‘i 26/8, anh Há»“ Thanh Tuáº¥n - Chá»§ tá»‹ch HÄQT ki&ecirc;m Tá»•ng gi&aacute;m Ä‘á»‘c C&ocirc;ng ty Ngá»c Trai Ho&agrave;ng Gia (quáº­n 7, TP HCM) nháº­n danh hiá»‡u Nghá»‡ nh&acirc;n Æ°u t&uacute; táº¡i Há»™i chá»£ h&agrave;ng thá»§ c&ocirc;ng má»¹ nghá»‡ nÄƒm 2016, do Bá»™ C&ocirc;ng ThÆ°Æ¡ng tá»• chá»©c táº¡i Khu triá»ƒn l&atilde;m Ho&agrave;ng th&agrave;nh ThÄƒng Long (H&agrave; Ná»™i). Nghá»‡ nh&acirc;n 40 tuá»•i n&agrave;y tá»« ngÆ°á»i thá»£ Ä‘&atilde; l&agrave;m chá»§ c&ocirc;ng nghá»‡, s&aacute;ng cháº¿ ra nhiá»u loáº¡i ngá»c khiáº¿n giá»›i y&ecirc;u ngá»c ná»©c l&ograve;ng.</p>\r\n<table align="right" class="picture">\r\n	<tbody>\r\n		<tr>\r\n			<td class="pic">\r\n				<img alt="Nghe nhan 7X lam thay doi lich su ngoc trai the gioi hinh anh 1" height="752" src="http://img.v3.news.zdn.vn/w660/Uploaded/rohunuk/2016_08_26/Tuan_1.jpg" width="1000" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td class="pCaption caption">\r\n				Ph&oacute; chá»§ tá»‹ch Quá»‘c há»™i U&ocirc;ng Chu LÆ°u trao danh hiá»‡u Nghá»‡ nh&acirc;n Æ°u t&uacute; cho anh Há»“ Thanh Tuáº¥n v&agrave;o tá»‘i 26/8. áº¢nh: <em><strong>Nháº­t T&acirc;n.</strong></em></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p>\r\n	Kh&ocirc;ng chá»‰ l&agrave; ngÆ°á»i nghá»‡ nh&acirc;n gi&agrave;u sá»©c s&aacute;ng táº¡o, y&ecirc;u nghá», anh Tuáº¥n c&ograve;n Ä‘Æ°á»£c biáº¿t Ä‘áº¿n vai tr&ograve; nhÆ° má»™t doanh nh&acirc;n th&agrave;nh Ä‘áº¡t vá»›i thÆ°Æ¡ng hiá»‡u Ngá»c Trai Ho&agrave;ng Gia - Ä‘Æ¡n vá»‹ dáº«n Ä‘áº§u ng&agrave;nh nu&ocirc;i cáº¥y v&agrave; cháº¿ t&aacute;c trang sá»©c ngá»c trai táº¡i Viá»‡t Nam.</p>\r\n<h3>\r\n	<strong>Tá»«ng tráº¯ng tay v&igrave; ngá»c trai</strong></h3>\r\n<p>\r\n	Lá»›n l&ecirc;n trong gia Ä‘&igrave;nh cha l&agrave;m vÆ°á»n, máº¹ má»Ÿ tiá»‡m táº¡p h&oacute;a gáº§n chá»£ x&atilde; Má»¹ HÆ°Æ¡ng cá»§a h